import './App.css';
import MatterWorld from './MatterWorld';
// import useWindowDimensions from './useWindowDimensions';

function App() {
  const { width, height } = useWindowDimensions();

  return (
    <div className="App">
      <MatterWorld 
        width={width}
        height={height}
      />
    </div>
  );
}

export default App;
